import React, { useState, useEffect } from 'react'

export default function App(){


  const variables = {
    name: '',
  }

  const [data, SetData] = useState('colombia')

  const nombre = "david";
  const id = "12"
  const url = `http://localhost:5000/login/${nombre}/${id}`;

  console.log(url)
  useEffect(()=> {

    fetch(url).then(

      res=> res.json()
    ).then(
        data=> {
          SetData(data)
          console.log("data",data)


        }
    )
  }, [])

  const { name } = this.variables

  return (
    <div>
      <h1>{data.nombre}</h1>
      <h1>Simple form</h1>
        <form>
          <label for>
            Name:
            <input
              type="text"
              value={name}
              onChange={(e) => this.setState({ name: e.target.value })}
            />
          </label>
        </form>

        <div>
          <h2>Values of the form</h2>
          <p>Name: {this.state.name}</p>
        </div>

  </div>
  );
};
